  input: '"TEXT","F3XA","C00187450","All employees spent less than 25% of their time
    on federal election activity. Therefore, their salaries, employee benefits and
    payroll taxes have been reported on Lines 21(a) and 21 (b). Expenditures and disbursements
    for Direct Mail, Postage for Direct Mail, Telemarketing Expenses, Telemarketing
    Fundraising and Telephone Exp V2002 were reported on Line 21(b).  These activities
    did not refer to a clearly identified candidate for Federal office nor did they
    promote, support, attack or oppose any candidate for Federal office.  These expenditures
    were for generic campaign activity. Payments for Telephone Expense, Publication,
    Issue Ad Mail-V2002 and Advanced Postage Deposit did not refer to a clearly identified
    candidate for Federal office nor did they promote, support, attack or oppose any
    candidate for Federal office.  These expenditures were for administrative and
    operating costs. Transportation-Gov. Perry to Stamp was not a contribution to
    another committee/organization. This disbursement was for transportation costs
    associated with party fundraising activities. All administrative expenses have
    been reported. Expenditures for voter registration and GOTV did not refer to a
    clearly identified candidate for Federal office nor did they promote, support,
    attack or oppose any candidate for Federal office.  These expenditures were for
    generic campaign activity. Expenditures for Promotional Items, Stampede to Victory
    Hotel Expense, Stampede-Stage and Audio, Facility Rental, and Advertising for
    Stampede,  Supplies for RWR Event, Supplies For Red, White &  Roux, Postage for
    JC Watts Event Invites, Deposit for Red, White & Roux, Facility Rental for JC
    Watts Event, Band for RWR Entertainment, Band Expense for Red, White & Roux, Photographer
    for RWR Fundraiser, Gift Baskets for Red, White & Roux, Red, White & Roux Printing,
    Printing for RWR, Red, White & Roux-Stage & Audio, Facility Rental- JC Watts Event,
    RWR Invitations Postage Deposit, RWR Invitation Postage were not made on behalf
    of specifically identified federal candidates. These disbursements were made for
    party fundraising activities"'
